import React from 'react'
import { connect } from 'react-redux';

const Player = () => {
  return (
    <div>
      <h2>Nome da categoria</h2>
      <h3> Selecionado </h3>
    </div>
  )
}

const mapStateToProps = (store) => ({
  selected: store.movie
});

export default connect(mapStateToProps, null)(Player);
